import React from 'react';

const Benefits = () => {
    return (
        <div className="benefits">
            <ul>
                <li>Completamente amueblado</li>
                <li>Servicios incluidos</li>
                <li>Alquileres flexibles</li>
                <li>Servicio de limpieza</li>
                <li>Gestores profesionales</li>
                <li>Comunidad de personas afines</li>
            </ul>
        </div>
    )
}

export default Benefits
